import { useState } from "react";

const BasicForm = (props) => {
  const [enteredFirstName, setEneteredFirstName] = useState("");
  const [enteredLastName, setEneteredLastName] = useState("");
  const [enteredEmail, setEneteredEmail] = useState("");

  return (
    <form>
      <div className="control-group">
        <div className="form-control">
          <label htmlFor="name">First Name</label>
          <input type="text" id="name" value={enteredFirstName} />
        </div>
        <div className="form-control">
          <label htmlFor="name">Last Name</label>
          <input type="text" id="name" value={enteredLastName} />
        </div>
      </div>
      <div className="form-control">
        <label htmlFor="name">E-Mail Address</label>
        <input type="text" id="name" value={enteredEmail} />
      </div>
      <div className="form-actions">
        <button>Submit</button>
      </div>
    </form>
  );
};

export default BasicForm;
